import React from 'react';
import logo from './logo.svg';
import './App.css';
import { urlGoogle } from './google-util';




function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit  and save to reload.
        </p>
        <a
          className="App-link"
          href= {urlGoogle()}
          target="_blank"
          rel="noopener noreferrer"
        >
          Sign in with Google
        </a>
      </header>
    </div>
  );
}




export default App;
